import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const BettingPage = ({ matchData }) => {
  const { matchId } = useParams();

  const [selectedTeam, setSelectedTeam] = useState(null);
  const [amount, setAmount] = useState('');
  const [runs, setRuns] = useState('');
  const [wickets, setWickets] = useState('');
  const [betType, setBetType] = useState(null);

  const handlePlaceBet = async () => {
    if (!selectedTeam || !amount) {
      alert('Please fill all required fields');
      return;
    }

    try {
      const response = await axios.post(`${process.env.REACT_APP_API_URL}/api/bet/place`, {
        username: localStorage.getItem('user') ? JSON.parse(localStorage.getItem('user')).username : '',
        matchId,
        team: selectedTeam,
        amount,
        betType: betType || 'winner', // default to winner
      });
      alert(response.data.message);
    } catch (error) {
      console.error('Error placing bet:', error);
      alert('Failed to place bet');
    }
  };

  return (
    <div className="betting-page">
      <h2>üî• Match: {matchData?.home_team} vs {matchData?.away_team} (Live)</h2>

      {/* Odds */}
      <div className="odds-section">
        <div className="odds-card">
          <button onClick={() => setSelectedTeam(matchData?.home_team)}>
            {matchData?.home_team} - {matchData?.home_odds}
          </button>
          <button onClick={() => setSelectedTeam(matchData?.away_team)}>
            {matchData?.away_team} - {matchData?.away_odds}
          </button>
        </div>
      </div>

      {/* Predict Runs */}
      <div className="input-section">
        <label>Predict Total Runs:</label>
        <input
          type="number"
          value={runs}
          onChange={(e) => {
            setRuns(e.target.value);
            setBetType('runs');
          }}
        />
      </div>

      {/* Predict Wickets */}
      <div className="input-section">
        <label>Predict Wickets:</label>
        <input
          type="number"
          value={wickets}
          onChange={(e) => {
            setWickets(e.target.value);
            setBetType('wickets');
          }}
        />
      </div>

      {/* Predict Winner */}
      <div className="input-section">
        <label>Predict Winner:</label>
        <div className="team-selection">
          <button
            className={selectedTeam === matchData?.home_team ? 'selected' : ''}
            onClick={() => {
              setSelectedTeam(matchData?.home_team);
              setBetType('winner');
            }}
          >
            {matchData?.home_team}
          </button>
          <button
            className={selectedTeam === matchData?.away_team ? 'selected' : ''}
            onClick={() => {
              setSelectedTeam(matchData?.away_team);
              setBetType('winner');
            }}
          >
            {matchData?.away_team}
          </button>
        </div>
      </div>

      {/* Amount */}
      <div className="input-section">
        <label>üí∞ Amount:</label>
        <input
          type="number"
          value={amount}
          onChange={(e) => setAmount(e.target.value)}
        />
      </div>

      {/* Buttons */}
      <div className="action-buttons">
        <button onClick={handlePlaceBet} className="confirm-button">
          ‚úÖ Confirm Bet
        </button>
        <button onClick={() => alert('Bet cancelled')} className="cancel-button">
          ‚ùå Cancel
        </button>
      </div>
    </div>
  );
};

export default BettingPage;
